import React, { useContext } from 'react';
import Header from '../../components/Header';
import SideBar from '../../components/SideBar';
import Classes from '../../context/ClassProvider';
import '../../styles/classPage.css';

const Aula1 = () => {
  const { aula1 } = useContext(Classes);

  return (
    <div>
      <Header />
      <div className='classPage'>
        <SideBar aula='transformador' listaConteudo={ aula1 }/>
        <div>
          <h2> Funcionamento:</h2>
          <p>
            Transformador, ou conhecido também como máquina elétrica estática, funciona a partir do eletromagnétismo.
          </p>
          <p>
            Um campo variante no tempo, passando por um condutor consegue fazer uma passagem de corrente elétrica, ainda se uma
            corrente variante passando por um indutor, produz um campo magnético.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Aula1;
